import React, { useState, useEffect } from 'react';

function GuestPage() {
    const [screeningsData, setScreeningsData] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/screenings/allScreenings')
            .then(response => response.json())
            .then(data => {
                setScreeningsData(data);
            })
            .catch(error => console.error(error));
    }, []);

    return (
        <div>
            <h1>Welcome as Guest</h1>
            <h2>Screenings:</h2>
            <ul>
                {screeningsData.map(screening => (
                    <li key={screening.id}>
                        {screening.movie && (
                            <div>
                                <p>Screenable Movie's Name: {screening.movie.movieName}</p>
                                <p>Genre: {screening.movie.genre}</p>
                                <p>Release Year: {screening.movie.releaseYear}</p>
                                <p>Runtime: {screening.movie.runTime}</p>
                                <p>Rating: {screening.movie.rating}</p>
                                <p>Pic URL: {screening.movie.picUrl}</p>
                            </div>
                        )}
                        {screening.room && (
                            <div>
                                <p>Room Name: {screening.room.room_name}</p>
                                <p>Total Seats: {screening.room.totalSeats}</p>
                            </div>
                        )}
                        <p>Start Time: {screening.startTime}</p>
                        <p>End Time: {screening.endTime}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default GuestPage;
